<!DOCTYPE html>
<html>
<head>
<meta charset="utf-8"/>
<title>First-Person Roguelike — Music</title>
<style>
  body { background:#000; color:#0f0; font-family:monospace; margin:0; }
  #gameWrap { display:flex; gap:10px; padding:10px; }
  canvas { border:1px solid #0f0; background:#000; }
  #ui { width:300px; }
  button{ width:100%; margin-bottom:6px; background:#111; color:#0f0; border:1px solid #0f0; padding:6px; cursor:pointer;}
  #log { height:160px; overflow:auto; border:1px solid #0f0; padding:6px; background:#000; color:#0f0; }
  .bar-container { width: 100%; height: 18px; background: #222; border: 1px solid #0f0; margin: 6px 0; }
  .bar { height: 100%; }
  .hp { background: linear-gradient(90deg, #ff4d4d, #cc0000); }
  .mp { background: linear-gradient(90deg, #4db8ff, #0066cc); }
  #inventoryCanvas { background:#111; display:block; margin-top:8px; border:1px solid #0f0; }
  .red-border { position: absolute; top:0; left:0; right:0; bottom:0; pointer-events:none; box-shadow: 0 0 0 0 rgba(255,0,0,0.0) inset; transition: box-shadow 0.15s ease-out; }
</style>
</head>
<body>
<div id="gameWrap">
  <canvas id="canvas" width="640" height="480"></canvas>
  <div id="ui">
    <button onclick="newGame()">New Game</button>
    <div>HP</div>
    <div class="bar-container"><div id="hp-bar" class="bar hp"></div></div>
    <div>Mana</div>
    <div class="bar-container"><div id="mp-bar" class="bar mp"></div></div>
    <pre id="stats"></pre>
    <canvas id="inventoryCanvas" width="224" height="64"></canvas>
    <h3>Log</h3>
    <div id="log"></div>
    <div style="margin-top:8px;font-size:13px">
      Controls:<br>
      W/↑ forward • S/↓ back • A/← turn left • D/→ turn right<br>
      F = Fireball (3 MP) • H = Heavy Strike (-2 HP) • R = Heal (4 MP)<br>
      1 = Use Health Potion • 2 = Use Mana Potion
    </div>
  </div>
</div>

<div class="red-border" id="damageBorder"></div>

<script>
const sprites = document.getElementById('spritesImg');
const canvas = document.getElementById('canvas');
const ctx = canvas.getContext('2d');
const invCanvas = document.getElementById('inventoryCanvas');
const invCtx = invCanvas.getContext('2d');
const damageBorder = document.getElementById('damageBorder');

const bgm = document.getElementById('bgm');
const swingSfx = document.getElementById('swingSfx');
const goblinSfx = document.getElementById('goblinSfx');
const potionSfx = document.getElementById('potionSfx');
const doorSfx = document.getElementById('doorSfx');
const chestSfx = document.getElementById('chestSfx');

const MAP_W = 20, MAP_H = 20;
let state = { };

function rngFactory(seed){ return function(){ seed = (seed + 0x6D2B79F5) | 0; var t = Math.imul(seed ^ seed >>> 15, 1 | seed); t ^= t + Math.imul(t ^ t >>> 7, t | 61); return ((t ^ t >>> 14) >>> 0) / 4294967296; }; }

function newGame(seed){
  state = { };
  state.seed = (seed === undefined) ? Math.floor(Math.random()*1e9) : seed;
  state.rng = rngFactory(state.seed);
  state.map = generateMap();
  state.enemies = [];
  state.items = [];
  state.turn = 0;
  state.player = {
    x: 2, y: 2,
    hp: 24, maxHp: 24,
    mp: 10, maxMp: 10,
    dir: 0,
    poison: 0,
    inventory: { health: 0, mana: 0, keys: 0, weapon: null }
  };
  spawnStuff();
  pushMessage('New game (seed ' + state.seed + ')');
  if(bgm.paused) { bgm.volume = 0.2; bgm.play().catch(()=>{}); }
  draw();
}

function generateMap(){
  let map = [];
  for(let y=0;y<MAP_H;y++){
    let row = [];
    for(let x=0;x<MAP_W;x++){
      if(x===0||y===0||x===MAP_W-1||y===MAP_H-1) row.push('#'); else row.push('.');
    }
    map.push(row);
  }
  for(let i=0;i<50;i++){
    let x = Math.floor(state.rng()*(MAP_W-2))+1;
    let y = Math.floor(state.rng()*(MAP_H-2))+1;
    map[y][x] = '#';
  }
  return map;
}

function spawnStuff(){
  for(let i=0;i<6;i++){ let x=Math.floor(state.rng()*(MAP_W-2))+1; let y=Math.floor(state.rng()*(MAP_H-2))+1; if(state.map[y][x]==='.') state.enemies.push({x,y,hp:8,name:'Goblin', lunge:0}); }
  for(let i=0;i<6;i++){ let x=Math.floor(state.rng()*(MAP_W-2))+1; let y=Math.floor(state.rng()*(MAP_H-2))+1; if(state.map[y][x]==='.') state.items.push({x,y,type:'chest'}); }
  for(let i=0;i<4;i++){ let x=Math.floor(state.rng()*(MAP_W-2))+1; let y=Math.floor(state.rng()*(MAP_H-2))+1; if(state.map[y][x]==='.') state.items.push({x,y,type:'door'}); }
}

// Utilities
function pushMessage(m){ const log=document.getElementById('log'); log.innerHTML = m + '<br>' + log.innerHTML; }
function dirToDelta(dir){ if(dir===0) return [0,-1]; if(dir===1) return [1,0]; if(dir===2) return [0,1]; return [-1,0]; }

// Audio helpers
function playSfx(el){ try{ el.currentTime = 0; el.play(); }catch(e){} }

// Player actions
function spendMana(cost){ if(state.player.mp < cost){ pushMessage('Not enough mana'); draw(); return false; } state.player.mp -= cost; return true; }

function fireballAttack(){
  if(!spendMana(3)) return;
  const [dx,dy] = dirToDelta(state.player.dir);
  let x=state.player.x, y=state.player.y;
  for(let d=1; d<Math.max(MAP_W,MAP_H); d++){
    x += dx; y += dy;
    if(x<0||y<0||x>=MAP_W||y>=MAP_H) break;
    if(state.map[y][x]==='#'){ pushMessage('Fireball hits a wall'); playSfx(swingSfx); break; }
    const enemy = state.enemies.find(e=>e.x===x&&e.y===y);
    if(enemy){ enemy.hp -= 6; pushMessage('Fireball hits the ' + enemy.name + ' (-6)'); playSfx(swingSfx); if(enemy.hp<=0){ state.enemies = state.enemies.filter(e=>e!==enemy); pushMessage('The ' + enemy.name + ' dies.'); } break; }
  }
  enemiesTurn();
}

function heavyStrike(){
  const [dx,dy] = dirToDelta(state.player.dir);
  const tx = state.player.x + dx, ty = state.player.y + dy;
  const enemy = state.enemies.find(e=>e.x===tx&&e.y===ty);
  if(enemy){
    let weaponBonus = state.player.inventory.weapon ? 2 : 0;
    enemy.hp -= 7 + weaponBonus;
    state.player.hp -= 2;
    pushMessage('You perform a heavy strike! Enemy -' + (7+weaponBonus) + ', you -2.');
    playSfx(swingSfx);
    if(enemy.hp<=0){ state.enemies = state.enemies.filter(e=>e!==enemy); playSfx(chestSfx); pushMessage('The ' + enemy.name + ' falls.'); }
    if(state.player.hp<=0) pushMessage('You collapse from your wounds...');
  } else { pushMessage('You swing at nothing.'); }
  enemiesTurn();
}

function healSpell(){
  if(!spendMana(4)) return;
  if(state.player.hp < state.player.maxHp){
    state.player.hp = Math.min(state.player.maxHp, state.player.hp + 6);
    pushMessage('You cast Heal (+6 HP).'); playSfx(potionSfx);
  } else pushMessage('Already at full HP.');
  enemiesTurn();
}

// Inventory use
function useHealthPotion(){ if(state.player.inventory.health>0){ state.player.inventory.health--; state.player.hp = Math.min(state.player.maxHp, state.player.hp+8); pushMessage('You use a health potion (+8 HP)'); playSfx(potionSfx); enemiesTurn(); } else pushMessage('No health potions'); }
function useManaPotion(){ if(state.player.inventory.mana>0){ state.player.inventory.mana--; state.player.mp = Math.min(state.player.maxMp, state.player.mp+5); pushMessage('You use a mana potion (+5 MP)'); playSfx(potionSfx); enemiesTurn(); } else pushMessage('No mana potions'); }

// Enemy AI (with lunge)
function enemiesTurn(){
  for(let e of state.enemies){
    const dist = Math.abs(e.x - state.player.x) + Math.abs(e.y - state.player.y);
    if(dist > 2 && state.rng() < 0.5){ const dir=Math.floor(state.rng()*4); const [dx,dy]=dirToDelta(dir); const nx=e.x+dx, ny=e.y+dy; if(nx>0&&ny>0&&nx<MAP_W-1&&ny<MAP_H-1 && state.map[ny][nx]==='.' && !(nx===state.player.x&&ny===state.player.y)){ e.x=nx; e.y=ny; } }
    if(Math.abs(e.x - state.player.x) + Math.abs(e.y - state.player.y) === 1){
      const roll = state.rng();
      e.lunge = 4;
      playSfx(goblinSfx);
      if(roll < 0.18){ state.player.hp -= 4; pushMessage('The ' + e.name + ' heavy-swings you (-4)'); }
      else { state.player.hp -= 2; pushMessage('The ' + e.name + ' hits you (-2)'); }
      damageFlash();
    }
    const md = Math.abs(e.x - state.player.x) + Math.abs(e.y - state.player.y);
    if(md === 2 && state.rng() < 0.12){ state.player.poison = Math.max(state.player.poison,5); pushMessage('You are poisoned!'); }
  }
  if(state.player.poison > 0){ state.player.poison--; state.player.hp -= 1; pushMessage('Poison -1'); }
  if(state.player.mp < state.player.maxMp) state.player.mp = Math.min(state.player.maxMp, state.player.mp + 1);
  if(state.player.hp <= 0) pushMessage('You have died. Game Over.');
  state.turn++; draw();
}

// Damage flash
function damageFlash(){
  damageBorder.style.boxShadow = '0 0 0 6px rgba(255,0,0,0.7) inset';
  setTimeout(()=>{ damageBorder.style.boxShadow = '0 0 0 0 rgba(255,0,0,0) inset'; }, 150);
}

// Drawing helpers
const TILE = 16;
function drawSpriteTile(tx, ty, dx, dy, scale, context){
  const sx = tx * TILE, sy = ty * TILE;
  const dw = Math.max(8, TILE * scale), dh = Math.max(8, TILE * scale);
  context.drawImage(sprites, sx, sy, TILE, TILE, Math.round(dx), Math.round(dy), dw, dh);
}

function draw(){
  ctx.fillStyle = '#000'; ctx.fillRect(0,0,canvas.width,canvas.height);
  const W = canvas.width, H = canvas.height;
  ctx.fillStyle='#111'; ctx.fillRect(0,0,W,H/2);
  ctx.fillStyle='#222'; ctx.fillRect(0,H/2,W,H/2);

  const [dx,dy] = dirToDelta(state.player.dir);
  const px = state.player.x, py = state.player.y;

  for(let d=1; d<=3; d++){
    const tx = px + dx * d, ty = py + dy * d;
    if(tx<0||ty<0||tx>=MAP_W||ty>=MAP_H) break;
    const scale = 1 / (d * 0.85);
    const rectW = Math.round(W * 0.8 * scale), rectH = Math.round(H * 0.8 * scale);
    const rectX = Math.round((W - rectW) / 2), rectY = Math.round((H - rectH) / 2);
    if(state.map[ty][tx] === '#'){
      drawSpriteTile(0,0, rectX, rectY, Math.max(1, 4/d), ctx);
      break;
    }
    ctx.strokeStyle = '#444'; ctx.lineWidth = Math.max(2, 6 * scale);
    ctx.beginPath();
    ctx.moveTo(rectX, rectY); ctx.lineTo(rectX, rectY+rectH);
    ctx.moveTo(rectX+rectW, rectY); ctx.lineTo(rectX+rectW, rectY+rectH);
    ctx.stroke();
    const enemy = state.enemies.find(e=>e.x===tx && e.y===ty);
    if(enemy){
      let lungeOffset = 0;
      if(enemy.lunge && enemy.lunge > 0){ lungeOffset = 12 * (enemy.lunge/4); enemy.lunge--; }
      drawSpriteTile(3,0, W/2 - 24*scale + lungeOffset, H/2 - 24*scale, 3/d, ctx);
    }
    const item = state.items.find(it=>it.x===tx && it.y===ty);
    if(item){
      if(item.type === 'door') drawSpriteTile(1,1, W/2 - 16*scale, H/2 - 16*scale, 3/d, ctx);
      if(item.type === 'chest') drawSpriteTile(0,1, W/2 - 16*scale, H/2 - 16*scale, 3/d, ctx);
    }
  }

  document.getElementById('hp-bar').style.width = Math.max(0, Math.min(100, 100 * state.player.hp / state.player.maxHp)) + '%';
  document.getElementById('mp-bar').style.width = Math.max(0, Math.min(100, 100 * state.player.mp / state.player.maxMp)) + '%';
  document.getElementById('stats').innerText =
    `HP: ${state.player.hp}/${state.player.maxHp}\nMP: ${state.player.mp}/${state.player.maxMp}\nFacing: ${['North','East','South','West'][state.player.dir]}\nTurn: ${state.turn}\n${state.player.poison>0 ? 'Poisoned ('+state.player.poison+' turns)':''}`;
  drawInventory();
}

function drawInventory(){
  invCtx.fillStyle = '#111'; invCtx.fillRect(0,0,invCanvas.width,invCanvas.height);
  let slotX = 6;
  const iconScale = 2;
  if(state.player.inventory.keys>0){
    drawSpriteTile(2,1, slotX, 8, iconScale, invCtx);
    invCtx.fillStyle = '#fff'; invCtx.font='12px monospace'; invCtx.fillText('x'+state.player.inventory.keys, slotX+26, 20);
    slotX += 56;
  }
  if(state.player.inventory.health>0){
    drawSpriteTile(0,2, slotX, 8, iconScale, invCtx);
    invCtx.fillStyle = '#fff'; invCtx.font='12px monospace'; invCtx.fillText('x'+state.player.inventory.health, slotX+26, 20);
    slotX += 56;
  }
  if(state.player.inventory.mana>0){
    drawSpriteTile(1,2, slotX, 8, iconScale, invCtx);
    invCtx.fillStyle = '#fff'; invCtx.font='12px monospace'; invCtx.fillText('x'+state.player.inventory.mana, slotX+26, 20);
    slotX += 56;
  }
  if(state.player.inventory.weapon){
    drawSpriteTile(3,1, slotX, 8, iconScale, invCtx);
    invCtx.fillStyle = '#fff'; invCtx.font='12px monospace'; invCtx.fillText(state.player.inventory.weapon, slotX+36, 20);
    slotX += 56;
  }
}

document.addEventListener('keydown', (ev) => {
  const k = ev.key;
  if(k === 'ArrowUp' || k === 'w' || k === 'W'){
    const [dx,dy] = dirToDelta(state.player.dir);
    const nx = state.player.x + dx, ny = state.player.y + dy;
    if(nx<0||ny<0||nx>=MAP_W||ny>=MAP_H){ pushMessage('You cannot go that way'); draw(); return; }
    if(state.map[ny][nx] === '#'){ pushMessage('You bump into a wall'); playSfx(doorSfx); draw(); return; }
    state.player.x = nx; state.player.y = ny;
    const item = state.items.find(it => it.x===nx && it.y===ny);
    if(item){
      if(item.type === 'door'){
        if(state.player.inventory.keys>0){ state.player.inventory.keys--; pushMessage('You use a key to open the door'); state.items = state.items.filter(i=>i!==item); playSfx(doorSfx); }
        else pushMessage('A locked door blocks your way (need a key).');
      } else if(item.type === 'chest'){
        pushMessage('You open the chest...'); playSfx(chestSfx);
        state.items = state.items.filter(i=>i!==item);
        const r = state.rng();
        if(r < 0.25){ state.player.inventory.keys++; pushMessage('Found a key!'); }
        else if(r < 0.6){ state.player.inventory.health++; pushMessage('Found a health potion!'); }
        else if(r < 0.9){ state.player.inventory.mana++; pushMessage('Found a mana potion!'); }
        else { state.player.inventory.weapon = 'Rusty Sword'; pushMessage('Found a weapon: Rusty Sword!'); }
      }
    }
    enemiesTurn(); return;
  }
  if(k === 'ArrowDown' || k === 's' || k === 'S'){
    const [dx,dy] = dirToDelta(state.player.dir);
    const nx = state.player.x - dx, ny = state.player.y - dy;
    if(nx<0||ny<0||nx>=MAP_W||ny>=MAP_H){ pushMessage('You cannot go that way'); draw(); return; }
    if(state.map[ny][nx] === '#'){ pushMessage('You bump into a wall'); playSfx(doorSfx); draw(); return; }
    state.player.x = nx; state.player.y = ny;
    enemiesTurn(); return;
  }
  if(k === 'ArrowLeft' || k === 'a' || k === 'A'){ state.player.dir = (state.player.dir + 3) % 4; draw(); return; }
  if(k === 'ArrowRight' || k === 'd' || k === 'D'){ state.player.dir = (state.player.dir + 1) % 4; draw(); return; }
  if(k === 'f' || k === 'F'){ fireballAttack(); return; }
  if(k === 'h' || k === 'H'){ heavyStrike(); return; }
  if(k === 'r' || k === 'R'){ healSpell(); return; }
  if(k === '1'){ useHealthPotion(); return; }
  if(k === '2'){ useManaPotion(); return; }
});

sprites.onload = function(){ newGame(); };

</script>
</body>
</html>
